import React from "react";
import meRing from "../..//Assets/meRing.png";

const Hero = () => {
  return (
    <section className="hero" id="home">
      <div className="left top">
        <h1>Hello World</h1>
      </div>
      <div className="right">
        <img src={meRing} alt="myProfile-img" draggable="false" />
      </div>
    </section>
  );
};
export default Hero;
